import React from 'react';
import { useSelector } from 'react-redux';

function Cart() {
    const { cart } = useSelector((store) => ({ ...store }));
//   console.log("cart====",cart);
  return (
    <div>
        {cart.map((e)=>(
            <h1>{e.id}</h1>
        ))}
    </div>
  )
}

export default Cart
